DELIMITER ;;
CREATE TRIGGER `teachers_BEFORE_UPDATE` BEFORE UPDATE ON `teachers` FOR EACH ROW BEGIN
UPDATE `user`
SET `password_hash` = new.password_hash,
 `auth_key` = new.auth_key,
 `password_reset_token` = new.password_reset_token,
 `email` = new.email,
